import React from "react";
import "./Navbar.css";

import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <a href="/" className="title">
        Call App
      </a>
      <ul>
        <li>
          <Link to='/'>About</Link>
        </li>

        <li>
          <a href="Contact">Contact</a>
        </li>
        <li>
          <a href="SignIn">Sign In</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
